import React, { useState } from 'react';
import AddActivityForm from '../components/AddActivityForm';
import { Activity } from '../types/Activity';

interface AddActivityPageProps {
  activities: Activity[];
}

function AddActivityPage(props: AddActivityPageProps): JSX.Element {
  const [activityList, setActivityList] = useState(props.activities);

  // Funktion för att lägga till en ny aktivitet i activities
  function addNewActivity(newActivity: Activity) {
    setActivityList([...activityList, newActivity]);
  }

  return (
    <>
      <h1>add page</h1>

      {/* Rendera listan med aktiviteter */}
      <ul>
        {activityList.map((activity) => (
          <li key={activity.id}>
            <h2>{activity.title}</h2>
            <p>{activity.content}</p>
            <p>Date: {activity.date}</p>
            <p>Max Count: {activity.maxCount}</p>
          </li>
        ))}
      </ul>

      {/* Rendera AddActivityForm och skicka med addNewActivity-funktionen */}
      <AddActivityForm onSubmit={addNewActivity} />
    </>
  );
}

export default AddActivityPage;
